import React from 'react';

const Footer = () => {
    return (
        <footer>
            <nav className="navbar bg-dark">
                <div className="container-fluid">
                <p className="text-sm-end text">End aligned text on viewports sized SM (small) or wider.</p>
                </div>
            </nav>
        </footer>
    );
}


export default Footer;
